import React from 'react';


class Clients extends React.Component {

    render() {
        const {
            className,
            topOuterDivider,
            bottomOuterDivider,
            topDivider,
            bottomDivider,
            hasBgColor,
            invertColor,
            ...props
        } = this.props;


        return (
            <section
                {...props}
            >
                <div className="container">
                    <div
                    >
                        <ul className="list-reset">
                            <li className="reveal-from-bottom">
                                <img
                                    src={require('../images/ucsf-logo.png')}
                                    alt="Client 01"
                                    width={124}
                                    height={24} />
                            </li>
                            <li className="reveal-from-bottom" data-reveal-delay="150">
                                <img
                                    src={require('../images/vanderbilt-logo.png')}
                                    alt="Client 02"
                                    width={83}
                                    height={30} />
                            </li>
                        </ul>
                    </div>
                </div>
            </section>
        );
    }
}

Clients.propTypes = propTypes;
Clients.defaultProps = defaultProps;

export default Clients;
